import {BrowserRouter,Routes,Route} from 'react-router-dom';
import Announcement from './pages/Announcement';
import './App.css';
function App() {

  return (
    <BrowserRouter>
    <Routes>

      <Route path='/Announcement' element={<Announcement />}/>
    </Routes>
    </BrowserRouter>

  );
}

export default App;
